				newObr41= '92695-6';
				newObr42= 'Gastrointestinal bacterial pathogens panel - Stool by NAA with probe detection';
				break;
			default:
		} // end switch 

		obr['OBR.4']['OBR.4.1'] = newObr41;
		obr['OBR.4']['OBR.4.2'] = newObr42;
		if(debug>0) logger.error('DEBUG::'+scriptName+' END obr41: '+obr['OBR.4']['OBR.4.1'].toString()+' obr42: '+obr['OBR.4']['OBR.4.2'].toString());
	} // end if 

	if(obr['OBR.4']['OBR.4.3'].toString()!== 'LN') {
		obr['OBR.4']['OBR.4.3'] = 'LN';
	} // end if 

	// 2023-06-15 JER - MP-33: Modified to accommodate copying/substituting the ORC-9 Ordered Transaction DateTime for the Observation DateTime (OBR-7.1) and Speciment DateTime (SPM-18.1) 
	if(obr['OBR.7']['OBR.7.1'].toString().length<5) {
		if(typeof(arrOrderedTransactionDateTime[obrSegment])== 'undefined') {
			obr['OBR.7']['OBR.7.1']= arrOrderedTransactionDateTime[arrOrderedTransactionDateTime.length-1].toString();
		} else {
			obr['OBR.7']['OBR.7.1']= arrOrderedTransactionDateTime[obrSegment].toString();
		}
		arrObservationDateTime.push(obr['OBR.7']['OBR.7.1'].toString());
	} else {
		arrObservationDateTime.push(obr['OBR.7']['OBR.7.1'].toString());
	} // end for 

	// 2023-06-13 JER - Modified to evaluate if OBR-13 has multiple object instances evaluate each one and if determined 'Not Reported' delete this object instance
	// 2023-05-19 JER - Modified to remove the OBR-13.2 value (i.e. ~Not Reported) 
	var arrRelevantClinicalInfo= new Array();
	if(debug>0) logger.error('DEBUG::'+scriptName+' obr13 value: '+obr['OBR.13']+' to be evaluated where length: '+obr['OBR.13']['OBR.13.1'].length()); 
	if(obr['OBR.13']['OBR.13.1'].length()>1) {

		for each(obr13 in obr['OBR.13']['OBR.13.1']) {

			if(debug>0) logger.error('DEBUG::'+scriptName+' MORE THAN one obr13 type: '+typeof(obr13)+' value: '+obr13.toString()+' to be evaluated where length: '+obr13.toString().length); 
			if((obr13.toString().indexOf('None Reported')<0)&&(obr13.toString().indexOf('Not Reported')<0)) {
				arrRelevantClinicalInfo.push(obr13);
				if(debug>0) logger.error('DEBUG::'+scriptName+' MORE THAN one obr13 value: '+obr13.toString()+' does NOT contains None|Not Reported to be persisted into array: '+arrRelevantClinicalInfo);
			} // end if 
		} // end for each
		delete obr['OBR.13'];

	} else {

		if((obr['OBR.13']['OBR.13.1'].toString().indexOf('None Reported')>-1)&&(obr['OBR.13']['OBR.13.1'].toString().indexOf('Not Reported')>-1)) {
			if(debug>0) logger.error('DEBUG::'+scriptName+' ONLY one obr13 value: '+obr['OBR.13']['OBR.13.1'].toString()+' does CONTAIN either None|Not Reported DELETE');
			delete obr['OBR.13'];
		} // end if 

	} // end if

	if(debug>0) logger.error('DEBUG::'+scriptName+' MORE THAN one obr13 arrRelevantClinicalInfo type: '+typeof(arrRelevantClinicalInfo)+' value: '+arrRelevantClinicalInfo);
	if(arrRelevantClinicalInfo.length>0) {
		obr['OBR.13']['OBR.13.1']= arrRelevantClinicalInfo.toString();
		if(debug>0) logger.error('DEBUG::'+scriptName+' MORE THAN one obr13 type: '+typeof(obr['OBR.13']['OBR.13.1'])+' POST evaluation obr13: '+obr['OBR.13']['OBR.13.1']);
	} // end if 

	//  2023-12-01 JER - MP-44: Remove values in OBR-32 per TX request
	if(obr['OBR.32']) {
		if(debug>0) logger.debug('DEBUG::'+channelName+':'+scriptName+':'+' DELETE obr[OBR.32]: '+obr['OBR.32']);
		delete obr['OBR.32'];
	} // end if 

	obrSegment++;

} // end for each

