		arrOrderCode.push(obr41);
		*/
		switch (obr41) {
			case '749C','760C','759','760': 
				newObr41= '82159-5';
				newObr42= 'Respiratory pathogens DNA and RNA panel - Nasopharynx by NAA with non-probe detection';
				break;
			case 'HSVHOBGYNVAG','MHVAG','MLBVAG','544': 
