	// 2023-06-15 JER - MP-33: Modified to accommodate copying/substituting the ORC-9 Ordered Transaction DateTime for the Observation DateTime (OBR-7.1) and Speciment DateTime (SPM-18.1) 
	if(obr['OBR.7']['OBR.7.1'].toString().length<5) {
