			if(debug>0) logger.error('DEBUG::'+scriptName+' ONLY one obr13 value: '+obr['OBR.13']['OBR.13.1'].toString()+' does CONTAIN either None|Not Reported DELETE');
			delete obr['OBR.13'];
		} // end if 

	} // end if

	if(debug>0) logger.error('DEBUG::'+scriptName+' MORE THAN one obr13 arrRelevantClinicalInfo type: '+typeof(arrRelevantClinicalInfo)+' value: '+arrRelevantClinicalInfo);
	if(arrRelevantClinicalInfo.length>0) {
